DROP TABLE EMP CASCADE CONSTRAINTS;
DROP TABLE STOPS CASCADE CONSTRAINTS;
DROP TABLE LINES CASCADE CONSTRAINTS;
DROP TABLE SCHEDULES CASCADE CONSTRAINTS;
DROP TABLE TIMES CASCADE CONSTRAINTS;
DROP TABLE LINE_STOPS CASCADE CONSTRAINTS;
DROP TABLE OPERATIONS CASCADE CONSTRAINTS;
DROP TABLE OP_DETAILS CASCADE CONSTRAINTS;


CREATE TABLE EMP(
EMP_ID    VARCHAR(5),
EMP_TITLE    VARCHAR(5),
EMP_NAME    VARCHAR(20),
EMP_LNAME    VARCHAR(20),
EMP_PHONE    NUMBER(20),
EMP_ADDRESS    VARCHAR(25),
EMP_BRTHDAY    DATE,
EMP_HIRE_DATE    DATE,
MANAGER_ID    VARCHAR(5),
CONSTRAINT EMP_pk PRIMARY KEY (EMP_ID)
);


CREATE TABLE STOPS(
STOP_ID    VARCHAR(5),
STOP_NAME    VARCHAR(25),
STOP_ADDRESS    VARCHAR(25),
CONSTRAINT STOPS_pk PRIMARY KEY (STOP_ID)
);


CREATE TABLE LINES(
LINE_ID    VARCHAR(5),
LAUNCH_DATE    DATE,
LINE_LENGTH    NUMBER,
STATUS    VARCHAR(10),
CONSTRAINT LINES_pk PRIMARY KEY (LINE_ID)
);


CREATE TABLE SCHEDULES(
SCHEDULE_ID    VARCHAR(5),
LINE_ID    VARCHAR(5),
INTERNAL_ORDER    NUMBER,
SCHEDULE_DAY    VARCHAR2(10),
SCHEDULE_TIME_START    DATE,
CONSTRAINT SCHEDULES_pk PRIMARY KEY (SCHEDULE_ID)
);
--Schedules foreign key
alter table SCHEDULES add
CONSTRAINT SCHEDULES_LINE_ID_fk FOREIGN KEY (LINE_ID) REFERENCES LINES (LINE_ID);


CREATE TABLE TIMES(
TIME_ID    VARCHAR(5),
STOP_FROM    VARCHAR(5),
STOP_TO    VARCHAR(5),
TIME    NUMBER,
CONSTRAINT TIMES_pk PRIMARY KEY (TIME_ID)
);
--Times foreign keys
alter table TIMES add
CONSTRAINT TIMES_STOP_FROM_fk FOREIGN KEY (STOP_FROM) REFERENCES STOPS (STOP_ID);
alter table TIMES add
CONSTRAINT TIMES_STOP_TO_fk FOREIGN KEY (STOP_TO) REFERENCES STOPS (STOP_ID);


CREATE TABLE LINE_STOPS(
LINE_STOP_ID    VARCHAR(5),
LINE_ID    VARCHAR(5),
STOP_ORDER    NUMBER,
STOP_ID    VARCHAR(5),
CONSTRAINT LINE_STOPS_pk PRIMARY KEY (LINE_STOP_ID)
);
--Line stops foreign keys
alter table LINE_STOPS add
CONSTRAINT LINE_STOPS_LINE_fk FOREIGN KEY (LINE_ID) REFERENCES LINES (LINE_ID);
alter table LINE_STOPS add
CONSTRAINT LINE_STOPS_STOP_fk FOREIGN KEY (STOP_ID) REFERENCES STOPS (STOP_ID);


CREATE TABLE OPERATIONS(
OPERATION_ID    VARCHAR(5),
OP_DATE    DATE,
EMP_ID    VARCHAR(5),
LINE_ID    VARCHAR(5),
SCHEDULE_ID    VARCHAR(5),
CONSTRAINT OPERATIONS_pk PRIMARY KEY (OPERATION_ID)
);
--Operations foreign keys
alter table OPERATIONS add
CONSTRAINT OPERATIONS_EMP_fk FOREIGN KEY (EMP_ID) REFERENCES EMP (EMP_ID);
alter table OPERATIONS add
CONSTRAINT OPERATIONS_LINE_fk FOREIGN KEY (LINE_ID) REFERENCES LINES (LINE_ID);
alter table OPERATIONS add
CONSTRAINT OPERATIONS_SCHED_fk FOREIGN KEY (SCHEDULE_ID) REFERENCES SCHEDULES (SCHEDULE_ID);


CREATE TABLE OP_DETAILS(
OP_DETAILS_ID    VARCHAR(5),
OPERATION_ID    VARCHAR(5),
LINE_STOP_ID    VARCHAR(5),
STOP_ORDER    NUMBER,
EXPECTED_TIME    TIMESTAMP,
ACTUAL_TIME    TIMESTAMP,
NUM_OF_PASSANGERS    NUMBER,
CONSTRAINT OP_DETAILS_pk PRIMARY KEY (OP_DETAILS_ID)
);
--Operation details foreign key
alter table OP_DETAILS add
CONSTRAINT OP_DETAILS_OPERATION_fk FOREIGN KEY (OPERATION_ID) REFERENCES OPERATIONS (OPERATION_ID);

